import React from 'react';
import styles from './MainItem.module.css';
import outArrow from '../../../assets/img/outArrow.PNG';

const MainItem = (props) => (
  <div className={styles.MainItem}>
    <ul>
      <li>
        <h2>{props.title}</h2>
        <p>{props.desc}</p>
        <p>{props.tech}</p>
      </li>
      <li>
        <button src={outArrow}>Plus sign</button>
      </li>
    </ul>
  </div>
);

export default MainItem;
